        <h2>Fly Life Cycle</h2>
        <p>Flies occupy the order diptera and have a four stage life cycle but, depending on the fly's order, different time spans to go through that cyle. Fruit flies take 7 to 14 days, house flies 7 to 10 days and drain flies 10 to 15 days.</p>
